import React from "react";
import { Switch, Route } from "react-router-dom";
import { StockContextProvider } from "../context/StocksContext";
import Home from '../routes/Home';
import LandingPage from '../routes/LandingPage';
import Login from '../routes/Login';
import SignUp from '../routes/SignUp';
import StockDetails from '../routes/StockDetails';
import UpdatePost from '../routes/UpdatePost';
import "./App.css";

const App = () => {
  return (
    <StockContextProvider>
      <div className="formContainer">
        <Switch>
          <Route exact path = "/" component = {LandingPage} />
          <Route exact path = "/home" component = {Home} />
          <Route exact path = "/stocks/:id" component = {StockDetails} />
          <Route exact path = "/stocks/:id/update" component = {UpdatePost} />
          <Route exact path = "/login" component = {Login} />
          <Route exact path = "/signup" component = {SignUp} />
        </Switch>
      </div>
    </StockContextProvider>
  )
};

export default App;
